        var $content = JQ("<div>").addClass("hud-content");
        if (options.close) {
            function closeButton() {
                var button = JQ("<button>").addClass("close").html("&times;");
                button.on("click", function () { self.dismiss() });
                return button;
            }
            $hud.append(closeButton());
        }
